  "inlineSchema": "// === PRISMA SCHEMA FOR BRANDEX SUPER APP ===\n// Author: Zaid Dweiri\n// Description: This schema defines the backend structure for a scalable digital products e-commerce platform.\n// Database: PostgreSQL via NeonDB\n\n// === Datasource & Generator ===\n// prisma/schema.prisma\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"DATABASE_URL\")\n}\n\ngenerator client {\n  provider = \"prisma-client-js\"\n  output   = \"../client\"\n}\n\n// === Store ===\n// Represents a single e-commerce instance (multi-tenant architecture)\nmodel Store {\n  id     String @id @default(uuid())\n  name   String\n  userId String\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  categories Category[]\n  billboards Billboard[]\n  products   Product[]\n  orders     Order[]\n}\n\n// === Category ===\n// Used to classify products into sections (e.g., Logos, Flyers)\nmodel Category {\n  id          String @id @default(uuid())\n  storeId     String\n  billboardId String\n  name        String\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  products  Product[]\n  billboard Billboard @relation(fields: [billboardId], references: [id])\n  store     Store     @relation(fields: [storeId], references: [id])\n}\n\n// === Billboard ===\n// Visual banners on the store landing page\nmodel Billboard {\n  id       String @id @default(uuid())\n  storeId  String\n  label    String\n  imageUrl String\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  store      Store      @relation(fields: [storeId], references: [id])\n  categories Category[]\n}\n\n// === Product ===\n// Main digital product entity, sold through the storefront\nmodel Product {\n  id          String   @id @default(uuid())\n  storeId     String\n  categoryId  String\n  name        String\n  description String?\n  price       Decimal\n  keywords    String[] @default([]) // PostgreSQL array for search\n  downloadUrl String? // BunnyCDN secure file link\n  isFeatured  Boolean  @default(false)\n  isArchived  Boolean  @default(false)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  category   Category    @relation(fields: [categoryId], references: [id])\n  store      Store       @relation(fields: [storeId], references: [id])\n  image      Image[]\n  orderItems OrderItem[]\n\n  @@index([categoryId])\n  @@index([storeId])\n}\n\n// === Image ===\n// Preview image URLs hosted on BunnyCDN\nmodel Image {\n  id        String @id @default(uuid())\n  productId String\n  url       String\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  product Product @relation(fields: [productId], references: [id], onDelete: Cascade)\n}\n\n// === Order ===\n// Each order submitted by a user (can include multiple items)\nmodel Order {\n  id              String  @id @default(uuid())\n  storeId         String\n  isPaid          Boolean @default(false)\n  email           String\n  price           Decimal\n  phone           String?\n  address         String?\n  deliveryDetails String?\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  store      Store       @relation(fields: [storeId], references: [id])\n  orderItems OrderItem[]\n}\n\n// === OrderItem ===\n// A specific product within an order\nmodel OrderItem {\n  id        String @id @default(uuid())\n  orderId   String\n  productId String\n  price     Float\n\n  product Product @relation(fields: [productId], references: [id], onDelete: Cascade)\n  order   Order   @relation(fields: [orderId], references: [id])\n}\n",
